import React, { useState, useEffect } from 'react'
import '../stylesheets/check.css'
import axios from 'axios';

function Download() {
  const [data, setData]=useState({})
  const [file, setFile]=useState(null);
  const [title, setTitle]=useState(null);
  const url="http://localhost:3000/Check"
  const url2="http://localhost:3000/upload"
useEffect(()=>{
  axios.get(url).then(res=>{
    setData(res.data)
  })
},[])
const handleFileUpload = (event)=>{
  setFile(event.target.files[0].name);

   }

   const handleSubmit = async(event) => {
    event.preventDefault()
    const formData = new FormData();
    formData.append("selectedFile", file);
    try {
      const response = await axios({
        method: "post",
        url: url2,
        data: formData,
        headers: { "Content-Type": "multipart/form-data" },
      });
    } catch(error) {
      console.log(error)
    }
  }




  return(
      <div className='check_download'>
       <div className='welcome_download'>
        <div className='user'>Welcome !: {data.name} {data.surname} </div>
        </div>
         <form onSubmit={(e)=>handleSubmit(e)} className='form_download'>
          <div>
          <div>Hello!</div>
           <div>You can download your vidoes in this page</div>
           </div>
           <div></div>
          <input type='file' accept='.mp4' onChange={handleFileUpload}/>
          <input type='text' onChange={(e)=>setTitle(e.target.value)}/>
          <button>submit</button>
         </form>

      </div>
  )
}

export default Download;
